import React from "react";

import '../Css/ListaChat.css';

function ListaChat() {
  return(
    <div
    className='chat'>
      <div>
        <div>
          CHAT 1
        </div>
        <div>
          CHAT 2
        </div>
      </div>
      <div>
        FORMULARIO
      </div>
    </div>
  )
};

export default ListaChat;
